ll times, they do rely on third parties to provide information to them so that they can make it available to you. The Service Provider accepts no liability for any loss, direct or indirect, that you experience as a result of relying entirely on this functionality of the application.</p><p><br></p><p><br></p><p>The Service Provider may wish to update the application at some point. The application is currently available as per the requirements for the operating system (and for any additional systems they decide to extend the availability of the application to) may change, and you will need to download the updates if you want to continue using the application. The Service Provider does not guarantee that it will always update the application so that it is relevant to you and/or compatible with the particular operating system version installed on your device. However, you agree to always accept updates to the application when offered to you. The Service Provider may also wish to cease providing the application and may terminate its use at any time without providing termination notice to you. Unless they inform you otherwise, upon any termination, (a) the rights and licenses granted to you in these terms will end; (b) you must cease using the application, and (if necessary) delete it from your device.</p><p><br></p><p><br></p><p>Changes to These Terms and Conditions</p><p>The Service Provider may periodically update their Terms and Conditions. Therefore, you are advised to review this page regularly for any changes. The Service Provider will notify you of any changes by posting the new Terms and Conditions on this page.</p><p><br></p><p><br></p><p>These terms and conditions are effective as of 2024-04-17</p><p><br></p><p><br></p><p>Contact Us</p><p>If you have any questions or suggestions about the Terms and Conditions, please do not hesitate to contact the Service Provider at support@cscodetech.com.</p>'),
(3, 'Contact Us', 1, '<p>We’ll start with some questions and get you to the right place.</p><p><br></p><p>let’s get you some help. We’re going to ask you some questions and then connect you with a member of our support team.</p><p><br></p><p>Can you describe your issue in a few sentences? This will help our team understand what’s going on.</p><p><br></p><p>Skype: CSCODETECH</p><p><br></p><p>Facebook: CSCODETECH</p><p><br></p><p>WhatsApp: +91 7276465975</p>'),
(4, 'Cancellation  Policy', 1, '<div>The cancellation policy for CarLink\'s car rental bookings typically depends on various factors such as the type of booking, duration, and specific terms and conditions agreed upon during the reservation process. However, here\'s a generalized cancellation policy that CarLink might implement:</div><div><br></div><div>Cancellation Period: Customers can cancel their booking up to 24 hours before the scheduled pickup time for a full refund.</div><div><br></div><div>Late Cancellation Fee: If a cancellation occurs within 24 hours of the pickup time, a late cancellation fee equivalent to one day\'s rental charge may apply.</div><div><br></div><div>No-Show Policy: If a customer fails to pick up the reserved vehicle without prior cancellation, a no-show fee equivalent to one day\'s rental charge may be applied, and the booking may be automatically canceled.</div><div><br></div><div>Refund Process: Refunds for canceled bookings are typically processed within a specified timeframe, such as 5-7 business days, and issued back to the original payment method used during the booking process.</div><div><br></div><div>Exceptions: Certain bookings or promotions may have different cancellation policies, and customers are advised to review the specific terms and conditions associated with their reservation.</div>');

